    false,nt"url": null,nt"notes": "This annual narrative report for Alligator
    River NWR and Pea Island NWR summarizes Refuge activities during the 1991 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition is also covered.  The report includes a planning section
    which discusses the master plan, the management plan, public participation, compliance
    with environmental and cultural resource mandates, research, and investigations.
     Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given.  Habitat
    management is also covered.  Subjects include wetlands, forests, croplands, fire
    management, and pest control.  The wildlife section of the report discusses wildlife
    diversity, endangered species, threatened species, waterfowl, marsh birds, water
    birds, shorebirds, raptors, game mammals, marine mammals, scientific collections,
    animal control, marking, and bird banding.  The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive exhibits, hunting, fishing,
    trapping, wildlife observation, and law enforcement.  The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization/replacement, communications systems, computer
    systems, and energy conservation.  Cooperative programs and items of interest are
    provided at the end; Refuge brochures and newspaper articles are attached.  A childrenu2019s
    book called Tammy Turtle was originally attached to this report; it is available
    to FWS personnel.",nt"license_title": "License Not Specified",nt"extras":
